import gql from "graphql-tag";

const GET_BOOKS = gql`{
    getNotes {
        _id
        title
        content
        author
        place
    }
}`;

const GET_USERS = gql`{
    getUsers {
        name
        age
        email
    }
}`;

const USER_LOGIN = gql`{
    userLogin{
        email
        password
    }
}`;

const CREATE_NOTE = gql`
  mutation createNote(
      $title: String!,
      $content: String!,
      $author: String!,
      $place: String!,) {
    createNote(
        title: $title,
        content: $content,
        author: $author,
        place: $place,
    ){
        title
        content
        author
        place
    }
  }`;
  const DELETE_NOTE = gql`
    mutation deleteNote($_id:String!){
        deleteNote(
            _id: $_id
        ){
            _id
        }
    }
  `;
  const CREATE_USER = gql`
  mutation createUser(
      $name: String!,
      $age: String!,
      $email: String!,
      $password: String!,) {
    createUser(
        name: $name,
        age: $age,
        email: $email,
        password: $password,
    ){
        name
        age
        email
        password
    }
  }`;

export { GET_BOOKS,CREATE_NOTE, CREATE_USER, GET_USERS, DELETE_NOTE };
